data = data.replace('\n', '').replace('}{', '},{')
data = json.loads(data)

# UI Inputs
ticker = st.text_input("Enter stock ticker symbol:", "NFLX")
fast = st.slider("Select fast period", min_value=1, max_value=26, value=12, step=1)
slow = st.slider("Select slow period", min_value=30, max_value=100, value=50, step=5)
#try:
